import React from 'react'
import './UploadFiles.css';
import { Button } from './components/Button';
export default function UploadFiles() {
  return (
    <div className='card'>
        
        <input type="file" />
	  <div className='upload'>
      <Button > Upload File</Button>
      </div>
    </div>

  )
}
